if("/"==location.pathname){var CookieCulture=getCookie(".AspNetCore.Culture");console.log("CookieCulture=",CookieCulture);var HomePageCulture=CookieCulture;""==HomePageCulture&&(HomePageCulture=navigator.language),HomePageCulture.indexOf("zh-CN")>=0?window.location.href="/zh-cn":window.location.href="/en-us"}function getCookie(e){for(var o=e+"=",t=document.cookie.split(";"),r=0;r<t.length;r++){for(var u=t[r];" "==u.charAt(0);)u=u.substring(1);if(0==u.indexOf(o))return u.substring(o.length,u.length)}return""}